import React from 'react'
import Product from './Product.js'

function ProductList(props) {
    const model =
    <ul>
    {props.ProductList.map((product)=>
      {product.model} 
    )}
    </ul>
   
    return (
        <div></div>
    )
            
        
    
}

export default ProductList
